import { fetchApiResult } from "../helper";

import { API } from "aws-amplify";
import { ordersByUser } from "../graphql/queries";

const now = new Date();

class OrderApi {
  async getOrdersByUser(user) {
    const ordersDB = await API.graphql({
      query: ordersByUser,
      variables: { user: user.id.toString() },
    });

    console.log(ordersDB);
    return ordersDB;
  }

  async getTrips() {
    const response = await fetchApiResult(
      `/api/orders/trips?page=1&limit=1500`,
      "get"
    );
    console.log(response);
    return response;
  }
}

export const orderApi = new OrderApi();
